import React from 'react'

function Preloader() {
    const loading = useSelector(state => state.preloader.loading)
    return (
        <>
        {loading? 
            <div id="preloader_screen">
                <img src={require("../../images/preloader.gif")}></img>           
            </div>
            :
            <span></span>
        }
        </>
    )
}

export default Preloader
